s=serial.Serial(port='COM1',  bytesize=serial.EIGHTBITS, parity=serial.PARITY_NONE, stopbits=serial.STOPBITS_TWO, write_timeout=None, xonxoff=False, rtscts=False, dsrdtr=False,)
d1 = {}
d2 = {}

def parseastr(astr):
    """
    This function takes the data from the ReadWl command and parses it into 
    a 1D dictionary. The parsed function has the extra bits removed and is separated
    into the wavelength of the scan and its respective absorbance.
    
    Parameters:
        astr(string): A string of values formatted ...,wavelength,+absorbance,...
        
    Returns:
        d1(dict): A 1 dimensional dictionary that has wavelength absorbance as its
        key value pairs.
    """
        
    d1 = {}
    astr = astr.replace('\r',"")
    astr = astr.replace('\xa1',"")
    astr = astr.replace('\x06',"")
    astr = astr.replace('\x1e000',"")
    astr = astr.replace('\x03', "")
    astr = astr.replace('\x1a', "")
    asplit = astr.split('\n')
    asplit[0] = asplit[0][-9:]
    for i in asplit:
        j = i.split(",")
        if j != ['']:
            j[1]=j[1].replace('+',"")
            d1[j[0]] = j[1]
    return(d1)

def InitializeWl(row, col, startwl, endwl, step, series, cal):
    """
    A function that sends the spectrophotometer a wavelength scan command.

    Parameters
    ----------
    row : str
        The row of the well that will be scanned.
    col : str
        The column of the well that will be scanned.
    startwl : str
        The wavelength that the scan will start with.
    endwl : str
        The wavelength that the scan will end on.
    step : str
        The number of wavelengths skipped between scans.
    series : str
        The scan number.
    cal : str
        A calibration command. 1 means calibrate, 0 means no calibration.

    Returns
    -------
    None.

    """
    wl = '&'+row+col+startwl+endwl+step+series+cal+'000'+'\x03'
    #print(wl)
    s.write(bytes(wl, 'utf-8'))
    b = ''
    c = ''
    if (s.isOpen()):
        try:
            while(b != bytes('\x03', 'utf-8')):
                if(s.in_waiting>0): 
                    b=s.read()
                    a=b.decode('utf-8')
                    #print(a, end="")
                    c+=a
            print("")
            return(str(row+"x"+col))
        except:
            return
        #     print("\nError initializing scan")
    else:
        print("\nPort failed to open")
        return
    

def Calibrate(call):
    s.write(bytes(call, 'utf-8'))
    s.write(bytes('\x03', 'utf-8'))
    b = ''
    c = ''
    if (s.isOpen()):
        try:
            while(b != bytes('\x03', 'utf-8')):
                if(s.in_waiting>0): 
                    b=s.read()
                    a=b.decode('utf-8')
                    print(a, end="")
                    c+=a
            print("")
            return
        except:
            return
    else:
        print("\nPort failed to open")
        return    


def ReadWl(address):    
    x = 0
    if s.isOpen():
        try:
            astr = ""
            while(x != 3):
                if(s.in_waiting>0): 
                    b=s.read()
                    a=b.decode('utf-8')
                    astr += a
                    if b==bytes('\x1a', 'utf-8'):
                        x+=1
            return(parseastr(astr))
        except: 
            print("\nError during scan")
            print(address)
            return
    else:
        print("\nPort closed after initialization")
        return

def SingleWlScan(srow, erow, scol, ecol, wl):
    print("Start Scan\n")
    lenrow = len(range(int(erow)-int(srow)+1))
    lencol = len(range(int(ecol)-int(scol)+1))
    
    for k in range(lenrow):
        for j in range(lencol):
            row = str(k + int(srow)).zfill(2)
            col = str(j + int(scol)).zfill(2)
            xwl = str(1 + int(wl)).zfill(3)
            ROWCOL = row+"x"+col
            print("Scanning Row "+ row + ", Column "+ col)
            if col == scol and row == srow:
                series = "1"
                scan = ReadWl(InitializeWl(row, col, wl, xwl, '010', series, '1'))
                if scan is None:
                    return
                    print("something went wrong")
                d2[ROWCOL] = scan
                s.flush()
            elif col == ecol and row == erow:
                series = "3"
                scan = ReadWl(InitializeWl(row, col, wl, xwl, '010', series, '0'))
                if scan is None:
                    return
                    print("something went wrong")
                d2[ROWCOL] = scan
                s.flush()
            else:
                series = "2"
                scan = ReadWl(InitializeWl(row, col, wl, xwl, '010', series, '0'))
                if scan is None:
                    return
                    print("something went wrong")
                d2[ROWCOL] = scan
                s.flush()
    print("\nEnd Scan")
    return("Complete")    

