def FullSpectralScan(srow, erow, scol, ecol, startwl, endwl, step):
    print("Start Scan\n")
    lenrow = len(range(int(erow)-int(srow)+1))
    lencol = len(range(int(ecol)-int(scol)+1))
    
    for k in range(lenrow):
        for j in range(lencol):
            row = str(k + int(srow)).zfill(2)
            col = str(j + int(scol)).zfill(2)
            ROWCOL = row+"x"+col # Ex: ROWCOL = 1x2 (first row; second column). ROWCOL is a string object.
            print("Scanning Row "+ row + ", Column "+ col)
            if col == scol and row == srow:
                series = "1"
                scan = ReadWl(InitializeWl(row, col, startwl, endwl, step, series, '1'))
                if scan is None:
                    return
                d2[ROWCOL] = scan # the data from each scan for each well is stored using ROWCOL, which is an index key for the dictionary
                s.flush()
            elif col == ecol and row == erow:
                series = "3"
                scan = ReadWl(InitializeWl(row, col, startwl, endwl, step, series, '0'))
                if scan is None:
                    return
                d2[ROWCOL] = scan
                s.flush()
            else:
                series = "2"
                scan = ReadWl(InitializeWl(row, col, startwl, endwl, step, series, '0'))
                if scan is None:
                    return
                d2[ROWCOL] = scan
                s.flush()
    print("\nEnd Scan")
    return("Complete")

def load_popup():
    layout = [[sg.Text("Please be patient and do not click the window while the spectrophotometer is running", key ='new')],[sg.Button("I understand")]]
    window = sg.Window("Before you run...", layout, modal = True)
    while True:
        event, values = window.read()
        if event == "Exit" or event == sg.WIN_CLOSED or event == "I understand":
            break
        
    window.close()
    
    
