def main():
    window = make_window(0)
    while True:
        event, values = window.read(timeout = None)
        if event in (sg.WINDOW_CLOSED, 'Exit'):
            break
        elif event == 'optionmenu':
            if values["optionmenu"] == "Full Spectral Scan":
                window.close()
                window = make_window(0)
            elif values["optionmenu"] == "Single Wavelength Scan":
                window.close()
                window = make_window(1)
            elif values["optionmenu"] == "Timecourse Scan":
                window.close()
                window = make_window(2)
                
        elif event == 'Run Scan' and values["optionmenu"] == "Full Spectral Scan":
            
            srow = str(values['-srow-'])
            erow = str(values['-erow-'])
            scol = str(values['-scol-'])
            ecol = str(values['-ecol-'])
            startwl = str(values['-startwl-'])
            endwl = str(values['-stopwl-'])
            step = str(values['-step-'])

            load_popup()
            #It would be smart to put something here that will update the window with a running... box
            FullSpectralScan(srow, erow, scol, ecol, startwl, endwl, step)
            #Then put something here that says "done"
            
            s.flush()
            print("End of Communication")
            s.close()

    
            # csv_columns is a list; the first item is 'Well'
            csv_columns = ["Well"]
            # the next two lines use the first well d2["1x1"] to get the keys (wavelengths) to use as column names in the csv file
            #the .keys() function gets the keys without adding the objects assigned to them
            firstkey = list(d2)[0]
            csv_columns += list(d2[firstkey].keys())

            #now = datetime.now()    
            #date_total = now.strftime("%d-%m-%Y %H%M")
            #print(date_total)

            #filename = "C:/Users/sarto/Documents/Spec_"+date_total+".csv"
            
            csv_file = values['-SAVE AS-']
            print("Saving Data as:")
            print(csv_file)
            # creating the csv file using the data from the dictionary
            try:
                with open(csv_file, 'w', newline='') as csvfile:
                    writer = csv.DictWriter(csvfile, fieldnames=csv_columns)
                    writer.writeheader()
                    # for each key in the dictionary (each well)
                    for rowkey in d2:
                        tempdic=d2[rowkey] # returns the item attached to that key
                        tempdic['Well'] = rowkey 
                        writer.writerow(tempdic)
            except IOError:
                print("I/O error")

          
            
                
        elif event == 'Run Scan' and values["optionmenu"] == "Timecourse Scan":
            
            srow = str(values['-srow-'])
            erow = str(values['-erow-'])
            scol = str(values['-scol-'])
            ecol = str(values['-ecol-'])
            startwl = str(values['-startwl-'])
            endwl = str(values['-stopwl-'])
            step = str(values['-step-'])
            intv = int(values['-int-'])
            numreads = int(values['-numreads-']) # number of times it does a scan throughout the time course

            load_popup()
            
            # convert intv (minutes) to seconds so it can be used in time.sleep()
            intv_seconds = intv * 60
            
            for run in range(numreads):
                # run a full spectral scan
                FullSpectralScan(srow, erow, scol, ecol, startwl, endwl, step)
                
                # flush serial communication and wait for next scan
                s.flush()
                run_num = run + 1
                print("Creating csv file. Scan " + str(run_num) + " out of " + str(numreads) + " completed.")
                
                # create the columns for the csv file
                csv_columns = ["Well"]
                firstkey = list(d2)[0]
                csv_columns += list(d2[firstkey].keys())
                
                # get the timestamp for the scan
                now = datetime.now()
                timestamp = now.strftime("%d-%m-%Y_%H-%M")
                
                # save the csv file with the timestamp
                filename = "C:/Users/sarto/Documents/TimeCourseScans/SpecTimeCourse_Run"+ str(run).zfill(3) + "_" + timestamp +".csv"
                try:
                    with open(filename, 'w', newline='') as filename:
                        writer = csv.DictWriter(filename, fieldnames=csv_columns)
                        writer.writeheader()
                        for rowkey in d2:
                            tempdic=d2[rowkey]
                            tempdic['Well'] = rowkey
                            writer.writerow(tempdic)
                except IOError:
                    print("I/O error")
                    
                
                time.sleep(intv_seconds)
    

            print("Time course completed.")
            s.close()

        
              


        elif event == 'Run Scan' and values["optionmenu"] == "Single Wavelength Scan":
            
            srow = str(values['-srow-'])
